// Create your Body component here
import {FaGithub, FaLinkedin, FaStackOverflow} from "react-icons/fa";
import Avatar from 'portfolio\src\assets\Passport Photo.jpg';

const Body = () => {
    return(
        <div id= "body" className="body">
            <div className="body-container">
                <div className="body-profile">
                    <img className="body-img" alt="avatar" src={Avatar}/>
                    <div className="body-content">
                        <div className="body-headline">Nathan Githinji</div>
                        <div className="body-text">Web developer</div>
                        <div className="body-icons">
                            <a href="https://www.linkedin.com/in/nathan-githinji-rugo-4188772b1/" target="blank" rel="noreferrer"className="icon-link"><i>FaLinkedin</i></a>
                            <a href="https://github.com/Nathan-Rugo" target="blank" rel="noreferrer"className="icon-link"><i>FaGithub</i></a>
                            <a href="https://stackoverflow.com/users/24143572/viscereal28" target="blank" rel="noreferrer"className="icon-link"><i>FaStackOverflow</i></a>
                        </div>
                    </div>
                </div>
            </div>
        </div>
    )
}
export default Body;
